import React from 'react';
// import image from "../styles/background.jpg"



const footerStyle = {
    mainDiv: {

        backgroundSize: "cover",
        justifyContent: 'center',
        alignItems: 'center',
    },
    anchors: {
        fontSize: '50px',
        color: 'rgb(142, 151, 155)',
        textAlign: 'center',
    }
}


function Footer() {

    return (
    <div class="container">
        <div className="footer row align-items-center" style={footerStyle.mainDiv}>

            <a style={footerStyle.anchors} className="contact-links col-4" href="https://github.com/MaryiaVinogradova" target="_blank"><i
                className="bi bi-github"></i></a>

            <a style={footerStyle.anchors} className="contact-links col-4" href="https://www.linkedin.com/in/maryiavinogradova/"
                target="_blank"><i className="bi bi-linkedin"></i></a>

            <a style={footerStyle.anchors} className="contact-links col-4" href=""><i
                className="bi bi-stack-overflow"></i></a>

        </div>
    </div>
    );
}

export default Footer;
